    constructor(props){
        super(props);
        this.state={
            car:[],
            subRowData:[],
            employeeList:[]
        }
}

  componentDidMount(){
    var self = this;
    fetch('http://localhost:8000/GetCarByShowroom/?showroom='+this.props.match.params.id,)
    .then(function (res){
        return res.json();
    })
    .then(function(data){
        console.log(data);
        self.setState({
            car:data,
        })
    })

    fetch('http://localhost:8000/Showroom/'+this.props.match.params.id,)
    .then(function (res){
        return res.json();
    })
    .then(function(data){
        console.log(data);
        self.setState({
          subRowData:data,
        })
    })
}

  render(){
    return (
      <div className='container'>
        <div key={this.state.car.id}>
                       <h4 className="text-center">Show Info</h4>
                       <label><b>Show Info Id:</b></label>
                       <span >{this.state.room.id}</span>
                       <br/>
                       <label><b>Name:</b></label>
                       <span >{this.state.room.name}</span>
                       <br/>
                       <label><b>RegistrationNumber:</b></label>
                       <span className="text-center">{this.state.room.registrationNumber}</span>
                       <br/>
                       <label><b>logoType:</b></label>
                       <span>{this.state.room.logoType}</span>
                       <br/>
                       <label><b>logoType:</b></label>
                       <span>{this.state.room.logoType}</span>
                       <br/>
          </div>


        <div className="row">

                     {this.state.showroom.map((rowdata,i)=>
                     <div key={rowdata.id}>
                     <div className="card">
                  <div className="card-body">
                     <h4 className="text-center">Car Info</h4>
                     {/* <label><b>Show Info Id:</b></label>
                     <span >{rowdata.id}</span> */}
                     <label><b>Show Info Id:</b></label>
                     <span >{rowdata.car.id}</span>
                     <br/>
                     <label><b>Car Name:</b></label>
                     <span >{rowdata.car.name}</span>
                     <br/>
                     <label><b>car mileage:</b></label>
                     <span >{rowdata.car.mileage}</span>
                     <br/>
                     <label><b>year:</b></label>
                     <span >{rowdata.car.year}</span>
                     <br/>
                     <label><b>status:</b></label>
                     <span >{rowdata.car.status}</span>
                     <br/>
                     <label><b>transmission:</b></label>
                     <span >{rowdata.car.transmission}</span>
                     <br/>
                     <label><b>price:</b></label>
                     <span >{rowdata.car.price}</span>
                     <br/>



{/* 
                     (typeof(rowdata.showroom)=='object')?
                     <div>
                     {
                       rowdata.showroom.map((subRowData,k)=>
                       <div>{subRowData.name}</div>

                       )

                     }
                     </div> */}





                     {/* <label><b>Name:</b></label>
                     <span >{this.state.showroom.name}</span>
                     <br/>
                     <label><b>RegistrationNumber:</b></label>
                     <span className="text-center">{this.state.showroom.registrationNumber}</span>
                     <br/>
                     <label><b>logoType:</b></label>
                     <span>{this.state.showroom.logoType}</span> */}
                     <br/>



                       <br/>
                     </div>
                     </div> 
               </div>
                      )}


        </div>
      </div>
    );
  }
}

